import React from "react";
import {store} from "../store";
import axios from "axios";
import {setRange} from "../reducers/appReducer";

const delay = ms =>{
    return new Promise(resolve => {
        setTimeout(()=>{
            resolve()
        },ms)
    })
}

export const  start = () =>{
    let {historyArr,biologyArr,geographyArr,mixedArr} = [];
    // try {
    //     // await delay(1000);
    //     const response =  await axios.post('http://localhost:5000/history/range',{
    //         kind
    //     });
    //     // document.getElementById('preloader').hidden = true;
    //     return store.dispatch(setRange(response.data.response));
    //
    // } catch (e) {
    //     console.log(e.response);
    // }
    let history = store.getState().app.history;
    history.forEach((item)=>{
        switch (item.kind) {
            case 'history':
                historyArr.add(item)
                break;
            case 'biology':
                biologyArr.add(item)
                break;
            case 'geography':
                geographyArr.add(item)
                break;
            case 'mixed':
                mixedArr.add(item)
                break;
            default:
                break;

        }
    });

    console.log(historyArr);


    function sort(arr) {
        arr.sort((a,b)=>{
            return b.result - a.result;
        })
    }
}
